import './App.css';
import Footer from './components/Footer';
import Nav from './components/Nav'

const Layout = () => {
  return (
    <div>
      <Nav />

      <Outlet />

      <Footer />
    </div>
  )
}

function App() {
  return (
    <div className="app">
      <Routes></Routes>
    </div>
  );
}

export default App;
